// App.tsx
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './AuthContext';


import Header from './components/Header/Header';
import HomePage from './components/HomePage/HomePage';
import Words from './components/Words/Words';
import Word from './components/Words/Word';
import Schools from './components/Schools/Schools';
import School from './components/Schools/School';

import Study from './components/Study/Study';
import Progress from './components/Progress/Progress';

import LoginView from './components/Login/loginView'
import UserView from './components/User/userView'
import SignupView from './components/Signup/signupView'

const App: React.FC = () => {
    return (
        <AuthProvider>
            <BrowserRouter>
                <Routes>
                  <Route path="/" element={<HomePage />} />
                  <Route path="/words" element={<Words></Words>}></Route>
                  <Route path="/words/:wordId" element={<Word />} />  // Add this line
                  <Route path="/schools" element={<Schools></Schools>}></Route>
                  <Route path="/schools/:schoolId" element={<School></School>}></Route>
                  <Route path="/study/:userId" element={<Study></Study>}></Route>
                  <Route path="/progress/:userId" element={<Progress></Progress>}></Route>



                  <Route path="/login" element={<LoginView></LoginView>}></Route>
                  <Route path="/user" element={<UserView></UserView>}></Route>
                  <Route path="/signup" element={<SignupView></SignupView>}></Route>
                </Routes>
            </BrowserRouter>
        </AuthProvider>
    );
};

export default App;
